import React from 'react';
import Left from './Left';


function Category() {



  return (
    <div>
      <div className="container">
        <div className="row">
          <div className="col-3">
            <Left />
          </div>
          <div className="col-9">
          <table className="table" method="POST">
              <thead>  <tr>
                  <th scope="col">S.No</th>
                  <th scope="col">ID</th>
                  <th scope="col">Name</th>
                </tr>
              </thead>
              <tbody>
                {/* Map over the categories array and generate table rows */}
                {category.map((category, index) => (
                  <tr key={index}>
                    <th scope="row">{index + 1}</th>
                    <td>{category.id}</td>
                    <td>{category.name}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Category;
